import Vue from 'vue';

export default Vue.extend({
    name: "TaskListItem",
    props: ['value'],
    computed: {
        item(): any {
            return this.value;
        },
        this_class(): any {
            if (typeof this.$attrs.class === "object") {
                return {
                    ...(this.$attrs.class as object),
                    'task-list-item': true,
                }
            } else {
                return this.$attrs.class + ' task-list-item';
            }
        }
    },
    methods: {
        handleClick(item: any): void {
            this.$emit("click", item);
        }
    }
})
